Subclasses MUST use try ...finally as follows to ensure that the busy flag is reset to its original value:

 boolean oldBusy = isBusy();
 setBusy(true);
 try {
 	// do work
 } finally {
 	setBusy(oldBusy);
 }

The hash code of a list is defined to be the result of the following calculation:

  int hashCode = 1;
  Iterator<E> i = list.iterator();
  while (i.hasNext()) {
      E obj = i.next();
      hashCode = 31*hashCode + (obj==null ? 0 : obj.hashCode());
  }


This ensures that list1.equals(list2) implies that list1.hashCode()==list2.hashCode() for any two lists

